def inputName(i):
    return INPUT_PATH+str(i)

def joinInputsTo(i):
    os.system('rm '+JOINED_INPUT_PATH+str(i))
    os.system('touch '+JOINED_INPUT_PATH+str(i))
    for j in range(0, i+1):
        os.system('cat '+INPUT_PATH+str(j)+' >> '+JOINED_INPUT_PATH+str(i))
    return JOINED_INPUT_PATH+str(i)

def modelName(i):
    return MODEL_PATH+str(i)

def outputName(i):
    return OUTPUT_PATH+str(i)

def outputNameNoLearn(i):
    return OUTPUT_PATH+'.nolearn.'+str(i)

def learn(i):
    start = time.time()
    os.system(FLINKDIR+'/bin/flink run -c '+LEARN_CLASS+' '+JAR+' -in '+joinInputsTo(i)+' -out '+modelName(i)+ ' -delim , -iterations 4 -neg-sample-rate 19 -learning-rate 0.07  > /dev/null')
    end = time.time()
    print(str(end - start))

def evaluate_nolearn(i):
    start = time.time()
    os.system(FLINKDIR+'/bin/flink run -c '+EVAL_NOLEARN_CLASS+' '+JAR+' -in '+inputName(i+1)+' -out '+outputNameNoLearn(i)+' -delim , -model '+modelName(i)+' > /dev/null')
    end = time.time()
    day = -1
    inv = 0
    hit = 0
    ndcg = 0.0
    os.system('rm '+OUTPUT_NOLEARN_CSV+str(i))
    os.system('touch '+OUTPUT_NOLEARN_CSV+str(i))
    with open(outputNameNoLearn(i)) as f:
        for line in f:
            if 'Period' in line:
                day = int(line[(line.rfind(' ')+1):-1])
            if ':Number of invokes' in line:
                inv = int(line[(line.rfind(' ')+1):-1])
            if ':Avg nDCG' in line:
                ndcg = float(line[(line.rfind(' ')+1):-1])
            if ':Hit' in line:
                hit = int(line[(line.rfind(' ')+1):-1])
                os.system('echo "'+str(day)+','+str(inv)+','+str(ndcg)+','+str(hit/inv)+'" >> '+OUTPUT_NOLEARN_CSV+str(i))
    os.system('cat '+outputNameNoLearn(i))
